import React from 'react';
import {NavLink} from 'react-router-dom';

const Menu =()=>{
    return(
        <>
            <ul>
                <li><NavLink className="link" activeClassName="active" to='/'>Home</NavLink></li>
                <li><NavLink className="link" activeClassName="active" to='/a'>URL A</NavLink></li>
                <li><NavLink className="link" activeClassName="active" to='/b'>URL B</NavLink></li>
            </ul>
        </>
    );
};
export default Menu;
